import Order from "./Order"

function comp_A_Save(id, status) {
    alert("id: " + id + " status: " + status)
}

const ComponentA = () => {

    const order = {
        "restaurantName": "Sagar Ratna 9",
        "restaurantAddress": "D 56, Jabalpur, Maharashtra",
        "items": [
            {
                "name": "Burger",
                "price": 200,
                "quantity": "2"
            },
            {
                "name": "Pizza",
                "price": 250,
                "quantity": "1"
            },
            {
                "name": "Noodles",
                "price": 100,
                "quantity": "2"
            }
        ],
        "date": "20-08-2021 at 7:05pm",
        "total": 800,
        "status": "Delivered",
        "orderNumber": 70646715400,
        "phoneNumber": 9988776655,
        "address": "Pocket 4, Vivek Vihar, Delhi",
        "id": 9
    }

    return (
        <div>
            <h1>Component A</h1>
            <Order order={order} onSave={comp_A_Save} showSave={true} showStatusDropdown={true} />
        </div>
    )
}

export default ComponentA
